import React from 'react'; 
// import './GamesList.css';


const PGNDialog = ({text, closePopup}) => {
	return (
		<div className="pgn-container">
			<h1>{text}</h1> 
			<textarea placeholder="Enter something" value="https://lichess.org/game/export/6dFspuKY" id="inputpgn" /> 
			<span id="popupsubmit" className='pointer' value="submit" onClick={()=>closePopup(document.getElementById('inputpgn').value)}>Submit</span>
		</div>
		);

	changeHandler = (e) =>{
		this.setState({pgn_input: e.target.value});
	}
}
export default PGNDialog;
